Girl! During pregnancy, the body experiences extreme muscle expansion. Specifically, in the abdominal area, muscles enlarge and separate to make room for the baby. Postpartum those muscles need support shifting back to normal. Our Tummy Wrap Waist Trainer can aid in holding your abdominal muscles together; encouraging them to return to a tighter more contracted position. 
